import axios from 'axios';
import React from 'react';

function Adil() {
    const [DrinksCard, setDrinksCards] = React.useState([])
  React.useEffect(() => {
    
      axios
        .get('https://demo5518646.mockable.io/DrinksCard')
        .then((res) => {
          setDrinksCards(res.data);
        });
    
  }, []);

  const DrinksCards = DrinksCard.map((card) => <li key={card.id}>{card.name}</li>)
  return (
    <div>
      {DrinksCards}
    </div>
  )
}

export default Adil
